import React, { useState } from 'react';

const AddRestaurantForm = () => {
  const [formData, setFormData] = useState({
    restaurantName: "Alpha", 
    areaName: "lucknow",
    Rating: 4,
    DeliveryTime: 45,
    availability: 'true',
    cloudinaryImageId:'12',
    parentId:'',
  });

  const handleChange = (e) => {
    const { name, value, type } = e.target;
    setFormData((prevData) => ({
      ...prevData,
      [name]: type === 'number' ? parseFloat(value) : value,
    }));
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    console.log(formData);

    try {
      const response = await fetch('http://localhost:8001/api/addRestaurant', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify(formData),
      });

      console.log(response);

      if (!response.ok) {
        console.error(`Request failed with status ${response.status}`);
        return;
      }

      const json = await response.json();
      console.log('API Response:', json);

      setFormData({
        restaurantName: '',
        areaName: '',
        Rating: '',
        DeliveryTime: '',
        availability: '',
        cloudinaryImageId:'',
        parentId:'',
      });
    } catch (error) {
      console.error('Error:', error.message);
    }
  };

  return (
    <div className="container text-left">
      <h2>Add a New Restaurant</h2>
      <form className="custom-form" onSubmit={handleSubmit}>
        <div className="mb-3">
          <label className="form-label inline ">Restaurant Name:</label>
          <input
            type="text"
            className="form-control"
            name="restaurantName"
            value={formData.restaurantName}
            onChange={handleChange}
            required
          />
        </div>

        <div className="mb-3">
          <label className="form-label">Area Name:</label>
          <input
            type="text"
            className="form-control"
            name="areaName"
            value={formData.areaName}
            onChange={handleChange}
            required
          />
        </div>

        <div className="mb-3">
          <label className="form-label">Image:</label>
          <input
            type="text"
            className="form-control"
            name="cloudinaryImageId"
            value={formData.cloudinaryImageId}
            onChange={handleChange}
            required
          />
        </div>

        <div className="mb-3">
          <label className="form-label">ParentId:</label>
          <input
            type="text"
            className="form-control"
            name="parentId"
            value={formData.parentId}
            onChange={handleChange}
            required
          />
        </div>

        <div className="mb-3">
          <label className="form-label">Rating:</label>
          <input
            type="number"
            className="form-control"
            name="Rating"
            value={formData.Rating}
            onChange={handleChange}
            required
          />
        </div>

        <div className="mb-3">
          <label className="form-label">Delivery Time:</label>
          <input
            type="text"
            className="form-control"
            name="DeliveryTime"
            value={formData.DeliveryTime}
            onChange={handleChange}
            required
          />
        </div>

        <div className="mb-3">
          <label className="form-label">Availability:</label>
          <input
            type="text"
            className="form-control"
            name="availability"
            value={formData.availability}
            onChange={handleChange}
            required
          />
        </div>

        <button type="submit" className="btn btn-primary">Add Restaurant</button>
      </form>
    </div>
  );
};

export default AddRestaurantForm;
